package main

import (
  "fmt"
  "reflect"
  "strings"
)

func removeChar(s string, pos int) string {
  fmt.Println(">rc")
  if pos < 0 || pos > len(s) {
    return ""
  }

  result := strings.Join([]string{s[:pos], s[pos+1:]}, "")
  return result
}

func anagram(s string) []string {
  fmt.Println(">a", s)
  if len(s) == 0 {
    return nil
  } else if len(s) == 1 {
    return []string{s}
  }

  var finalStrs []string
  for k, _ := range s {
    newStr := removeChar(s, k)
    curStrs := anagram(newStr)
    
    // merge results
    for _, v := range curStrs {
      finalStrs = append(finalStrs, string(s[k]) + v)
    }
  }

  return finalStrs
}

func anagramHash(s string) map[string]bool {
  fmt.Println(">ah", s)
  if len(s) == 0 {
    return nil
  }

  a := anagram(s)
  ah := make(map[string]bool)

  for _, v := range a {
    ah[v] = true
  }

  return ah
}

// bang out something simple....
func isAnagramMatch(s1 string, sRef map[byte]int) bool {
  fmt.Println(">iam")
  s1Map := charCount(s1)
  return reflect.DeepEqual(s1Map, sRef)
}

// given a string return a hash map...
func charCount(s string) map[byte]int {
  m := make(map[byte]int)
  
  for _,v := range s {
    m[byte(v)] = m[byte(v)]+1
  }

  return m
}

func findAnagrams(s string, p string) []int {
  fmt.Println(">fa")
  if len(p) > len(s) {
    return nil
  }

  //pHash := anagramHash(p)
  result := make([]int, 0)
  pMap := charCount(p)

  for i,j := 0, len(p) ; j<=len(s) ; i,j = i+1, j+1 {
    //fmt.Println(i,j)
    if isAnagramMatch(s[i:j], pMap) {
      result = append(result, i)
    }
  }

  return result
}

